const styles = StyleSheet.create({

    containerFilmes:{
        paddingTop:10,
        paddingBottom:16,
        paddingRight:16,
        width:140

    },
    
    tituloFilmes:{
       color: '#fff',
       fontSize:12,
       paddingTop:8
    },


    notaFilmes:{
        fontSize:10,
        color: '#fff',
        paddingLeft:4
    },

    imagemFilmes:{
        width: 120,
        height:70,
        borderRadius:8
    }
})

export default styles
